export function calculateTimeDelay(dataArray: number[]) {
    let timeDelay: number;
    switch (dataArray.length) {
        case 25:
            timeDelay = 80;
            break;
        case 45:
            timeDelay = 40;
            break;
        case 65:
            timeDelay = 10;
            break;
        default:
            timeDelay = 0.5;
            break;
    }
    return timeDelay;
}
